import React from 'react';

const TaskList = ({ tasks, onTaskClick }) => {
    return (
        <div>
            <h3>Список задач</h3>
            <ul>
                {tasks.map(task => (
                    <li key={task.id} onClick={() => onTaskClick(task)}>
                        <span style={{ color: getStatusColor(task.status) }}>
                            {task.title}
                        </span>
                    </li>
                ))}
            </ul>
        </div>
    );
};

const getStatusColor = (status) => {
    switch (status) {
        case 'выполнена':
            return 'green';
        case 'к выполнению':
            return 'red';
        default:
            return 'grey';
    }
};

export default TaskList;
